function Incio(){
  return <h1>Hello World!</h1>
}
function App() {
  return (
    <CroctProvider appId="00000000-0000-0000-0000-000000000000"> 
    <div>
    <Inicio/>
    </div>
    </CroctProvider>
  );
}

export default App;
